import { useState, useEffect } from "react";
import axios from "axios";
import "../styles/Profile.css";

const AddUser = () => {
    const [user, setUser] = useState({
        fullname: "",
        email: "",
        phone_no: "",
        gender: "",
        dob: "",
        religion: "",
        caste: "",
        age: "",
        occupation: "",
        height: "",
        horoscope_details: "",
        fatherName: "",
        fatherOccupation: "",
        motherName: "",
        motherOccupation: "",
        brothers: 0,
        sisters: 0,
        familyStatus: "",
        familyType: "",
        familyValues: "",
        nativePlace: "",
    });
    const [isAuthenticated, setIsAuthenticated] = useState(false);

    useEffect(() => {
        // Check if token exists when component mounts
        const token = localStorage.getItem("token");
        if (token) {
            setIsAuthenticated(true);
        }
    }, []);

    const handleChange = (e) => {
        setUser({ ...user, [e.target.name]: e.target.value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const token = localStorage.getItem("token"); // Get admin token
            
            // Log token for debugging
            console.log("Token:", token);
            
            if (!token) {
                alert("You are not authenticated. Please login first.");
                return;
            }
            
            const response = await axios.post(
                "http://localhost:5000/api/user/add-user",
                user,
                {
                    headers: { 
                        "Authorization": `Bearer ${token}`,
                        "Content-Type": "application/json"
                    }
                }
            );
            
            // Reset form after successful submission
            setUser({
                fullname: "",
                email: "",
                phone_no: "",
                gender: "",
                dob: "",
                religion: "",
                caste: "",
                age: "",
                occupation: "",
                height: "",
                horoscope_details: "",
                fatherName: "",
                fatherOccupation: "",
                motherName: "",
                motherOccupation: "",
                brothers: 0,
                sisters: 0,
                familyStatus: "",
                familyType: "",
                familyValues: "",
                nativePlace: "",
            });
            
            alert("User added successfully!");
        } catch (error) {
            console.error("Error details:", error.response ? error.response.data : error.message);
            
            if (error.response && error.response.status === 401) {
                alert("Authentication failed. Please login again.");
            } else {
                alert(`Error adding user: ${error.response ? error.response.data.message : error.message}`);
            }
        }
    };

    return (
        <div className="add-user-container">
            <h2>Add User</h2>
            {!isAuthenticated && (
                <div className="auth-error">
                    Please login to add users.
                </div>
            )}
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <input type="text" name="fullname" value={user.fullname} placeholder="Full Name" onChange={handleChange} required />
                </div>
                <div className="form-group">
                    <input type="email" name="email" value={user.email} placeholder="Email" onChange={handleChange} required />
                </div>
                <div className="form-group">
                    <input type="text" name="phone_no" value={user.phone_no} placeholder="Phone No" onChange={handleChange} required />
                </div>
                <div className="form-group">
                    <select name="gender" value={user.gender} onChange={handleChange} required>
                        <option value="">Select Gender</option>
                        <option value="Male">Male</option>
                        <option value="Female">Female</option>
                        <option value="Other">Other</option>
                    </select>
                </div>
                <div className="form-group">
                    <input type="date" name="dob" value={user.dob} onChange={handleChange} required />
                </div>
                <div className="form-group">
                    <input type="text" name="religion" value={user.religion} placeholder="Religion" onChange={handleChange} required />
                </div>
                <div className="form-group">
                    <input type="text" name="caste" value={user.caste} placeholder="Caste" onChange={handleChange} />
                </div>
                <div className="form-group">
                    <input type="number" name="age" value={user.age} placeholder="Age" onChange={handleChange} required />
                </div>
                <div className="form-group">
                    <input type="text" name="occupation" value={user.occupation} placeholder="Occupation" onChange={handleChange} />
                </div>
                <div className="form-group">
                    <input type="text" name="height" value={user.height} placeholder="Height" onChange={handleChange} />
                </div>
                <div className="form-group">
                    <input type="text" name="horoscope_details" value={user.horoscope_details} placeholder="Horoscope Details" onChange={handleChange} />
                </div>

                <h3>Family Details</h3>
                <div className="form-group">
                    <input type="text" name="fatherName" value={user.fatherName} placeholder="Father's Name" onChange={handleChange} />
                </div>
                <div className="form-group">
                    <input type="text" name="fatherOccupation" value={user.fatherOccupation} placeholder="Father's Occupation" onChange={handleChange} />
                </div>
                <div className="form-group">
                    <input type="text" name="motherName" value={user.motherName} placeholder="Mother's Name" onChange={handleChange} />
                </div>
                <div className="form-group">
                    <input type="text" name="motherOccupation" value={user.motherOccupation} placeholder="Mother's Occupation" onChange={handleChange} />
                </div>
                <div className="form-group">
                    <input type="number" name="brothers" value={user.brothers} placeholder="Brothers" onChange={handleChange} />
                </div>
                <div className="form-group">
                    <input type="number" name="sisters" value={user.sisters} placeholder="Sisters" onChange={handleChange} />
                </div>
                <div className="form-group">
                    <input type="text" name="familyStatus" value={user.familyStatus} placeholder="Family Status" onChange={handleChange} />
                </div>
                <div className="form-group">
                    <input type="text" name="familyType" value={user.familyType} placeholder="Family Type" onChange={handleChange} />
                </div>
                <div className="form-group">
                    <input type="text" name="familyValues" value={user.familyValues} placeholder="Family Values" onChange={handleChange} />
                </div>
                <div className="form-group">
                    <input type="text" name="nativePlace" value={user.nativePlace} placeholder="Native Place" onChange={handleChange} />
                </div>

                <button type="submit" disabled={!isAuthenticated}>Add User</button>
            </form>
        </div>
    );
};

export default AddUser;
